import Link from 'next/link';

export default function About() {
    return (
      <div>
           <Link href="/">
            <a>About Page</a>
        </Link> || 
        <Link href="/index" title="Index Page">
            <a>About Page</a>
            </Link>
        <p>This is the about page</p>
      </div>
    );
  }
